clc ; clear;
%%

% --- 1. Define Parameters ---
M_w = 0.5;   % Mass of one wheel
M_r = 1.0;   % Mass of robot body
m_b = 0.02;  % Mass of the ball
R = 0.05;    % Radius of the wheel
h = 0.1;     % Height of robot CoM from ball platform
r = 0.002;   % Radius of the ball
g = 9.81;    % Gravity
d = 0.03; 

% --- 2. Moments of Inertia ---
I_w = 0.5 * M_w * R^2;        % Inertia of one wheel (Note: Not used in M1, M2, M3)
I_r_com = (1/12) * M_r * (h^2 + d^2);       % body about its own COM
I_r = I_r_com + M_r * d^2;              % Inertia of robot body (parallel axis theorem)
I_b = 0.4 * m_b * r^2;      % Inertia of a solid sphere ball

% --- 3. Derived Parameters ---
l = h + r; % Height of ball CoM from wheel center
%%

% --- 4. Define Matrices ---
% M1 = [[(I_b/(r^2))+m_b , -m_b*l],
%       [-m_b*l,            I_r+m_b*(l^2)]]
M1 = [(I_b/(r^2)) + m_b, m_b*l;
      m_b*l,            I_r + m_b*(l^2)];

% M2 = [[1,  1+(g*m_b)],
%       [1-(m_b*g), 1 - (M_r*d*g)-(m_b*g*l)]]
M2 = [1,             1 + (g*m_b);
      1 + (m_b*g), 1 + (M_r*d*g) + (m_b*g*l)];

% M3 = [[m_b*l],
%       [-m_b]]
M3 = [-m_b*l;
      -m_b];

% --- 5. Calculate A and B ---
% This is the numerically preferred method for A = inv(M1) * M2
A1 = M1 \ M2;

% This is the numerically preferred method for B = inv(M1) * M3
B1 = M1 \ M3;
%%

A = [0 1 0 0;... %[output:group:229a734b] %[output:60988226]
    A1(1,1) 0 A1(1,2) 0;... %[output:60988226]
    0 0 0 1;... %[output:60988226]
    A1(2,1) 0 A1(2,2) 0] %[output:group:229a734b] %[output:60988226]
B = -[0 ; B1(1); 0 ; B1(2)] %[output:06e878d2]
C = eye(4) %[output:717ff987]
D = zeros(4,1) %[output:052d9a1f]
%%
[num,den] = ss2tf(A,B,C,D) %[output:17d34675] %[output:9a8921cb]
%%
% --- 2. Create the individual Transfer Functions (TFs) ---

% H1(s) = Y1/U (from num row 1)
H1 = tf(num(1,:), den) %[output:8546a222]

% H2(s) = Y2/U (from num row 2)
H2 = tf(num(2,:), den) %[output:2e33cd79]

% H3(s) = Y3/U (from num row 3)
H3 = tf(num(3,:), den) %[output:0f51ec1d]

% H4(s) = Y4/U (from num row 4)
H4 = tf(num(4,:), den) %[output:88dfa763]
%%
sys = ss(A, B, C, D);
%%
rank(ctrb(A,B)) %[output:07841c68]
rank(obsv(A,C)) %[output:282facca]
%%
% step input
% step(sys)
%%
% sine input 
% t = 0:0.001:5;
% u = sin(2*pi*t);
% lsim(sys,u,t)
%%
% ramp input 
% t = 0:0.01:10;
% u = t;         
% lsim(sys, u, t)
%%
os = 10 %[output:1bd54954]
ts = 2 %[output:9ac58f3b]
a = 100/10 %[output:3eb243d2]
zeta = (a^2/ (a^2 + pi^2))^0.5 %[output:3aee1b83]
wn = 4/(zeta* ts) %[output:8efebd49]
p_c = roots([1 2*wn*zeta wn^2]) %[output:88fd023a]
poles = [p_c;-0.01;-0.02] %[output:639979c7]
K = place(A,B,poles) %[output:00b147e2]
x0 = [0.005, 0, deg2rad(2),0];
A_cl = A - B*K; % Closed-loop system matrix
%%

sys_cl = ss(A_cl, B, C, D);

% Simulate step response of closed-loop system:
step(sys_cl) %[output:3f89f8fc]
%%
n = size(A,1);          % Number of states: 4
C_track = [1 0 0 0];    % Track state 1 (change if you track a different state)
A_aug = [A, zeros(n,1); -C_track, 0];
B_aug = [B; 0];

% --- 6. Augmented pole placement ---
os = 2; ts = 0.1;
a = 100/10;
zeta = sqrt(a^2/ (a^2 + pi^2));
wn = 4/(zeta* ts);

p_c = roots([1 2*wn*zeta wn^2]);
poles = [p_c; -0.01; -0.02];
poles_aug = [poles; -0.1];      % Add integrator pole (can move if needed)

K_aug = place(A_aug, B_aug, poles_aug);

Kx = K_aug(1:n);      % State feedback gain
Ki = K_aug(n+1);      % Integral gain

% --- 7. Closed-loop Simulation with Reference Input ---
A_cl = [A, zeros(n,1); -C_track, 0] - [B;0]*[Kx Ki];
B_cl = [zeros(n,1); 1];  % Input is reference 'r' (not direct force)
C_cl = [C, zeros(4,1)];
D_cl = zeros(4,1);

sys_cl = ss(A_cl, B_cl, C_cl, D_cl);

% Simulate step input (reference = 1)
t = 0:0.01:20;
r = ones(size(t));
initial_state = [x0'; 0]; % [states; integrator_state]

lsim(sys_cl, r, t, initial_state); %[output:4d41566f]
title('Closed-loop Step Response with Integral Action'); %[output:4d41566f]
%%
% --- assume your script already computed H1, H2, H3, H4, sys ---

% Choose which SISO TF to design for (change to H2/H3/H4 if desired)
P = H1;      % plant: Y1(s)/U(s)

% Show open-loop poles/zeros
disp('Open-loop poles:'); pole(P) %[output:204cb2f0] %[output:1c95efe3]
disp('Open-loop zeros:'); zero(P) %[output:5e3de16a] %[output:319e174d]

% Plot root locus
figure; rlocus(P); title('Root locus of open-loop plant P(s)'); %[output:712c226d]

% If you want interactive gain selection:
% [K, poles] = rlocfind(P);   % interactively click on plot to choose closed-loop pole
% (Uncomment if you prefer graphical selection)

% Example: design a PI controller C(s) = Kp*(1 + Ki/s)
% Use lead/lag (PID) shape on RL to move locus where necessary.
% Let's build a PI with a zero at z = 1 (tunable)
z = 1;                % PI zero (try 0.1 .. 10)
s = tf('s');
C_pi = (s + z)/s;     % unity-gain PI structure (K will scale)
figure; rlocus(P*C_pi); title('Root locus of P(s)*C_{PI}(s)'); %[output:7bd5adba]

% Choose K by inspection or rlocfind:
% [Kpi, poles_cl] = rlocfind(P*C_pi);   % interactive
% Example starting gain (tune after plotting)
Kpi = 10;             % <-- adjust after looking at rlocus

C = Kpi * C_pi;

% Closed-loop from unity feedback
CL = feedback(P*C, 1);

% Plot step response and check steady-state
figure; %[output:2e85ec67]
step(CL); title('Closed-loop step response with PI controller'); %[output:2e85ec67]
Sinfo = stepinfo(CL); %[output:5bfaea7b]
disp(Sinfo); %[output:332e34bc]

% Steady-state error for step:
[y_ss, t] = step(CL, 0:0.01:20);
ess = abs(1 - y_ss(end));
fprintf('steady-state error (unit step): %g\n', ess); %[output:01ae53c0]

% Frequency margins
figure; margin(P*C); title('Margins of P*C'); %[output:2de932ad]

% If you need derivative action to improve damping, try PID:
% pid form: C_pid = K * (1 + 1/(Ti*s) + Td*s/(Tf*Td*s+1))
Ti = 0.5; Td = 0.05; Tf = 0.01;  % example
C_pid = Kpi * (1 + 1/(Ti*s) + (Td*s)/(Tf*Td*s + 1));
figure; rlocus(P*C_pid); title('RL: P*C_{PID}'); %[output:42c966fe]
CL_pid = feedback(P*C_pid, 1);
figure; step(CL_pid); title('Step response with PID'); %[output:92fd2b38]
stepinfo(CL_pid) %[output:34a74ec4] %[output:542d300a]



